import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Representatives} from './Representatives.js';
import {NavLink as RRNavLink, BrowserRouter} from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';

export class Navigation extends Component {
    constructor(props) {
      super(props);
    }
    render() {
      return (
        <div className="Navbar">
        <Navbar color="light" light expand="md">
          <NavbarBrand ><BrowserRouter>
                    <NavLink tag={RRNavLink} to="/">EmPoweringKnowledge</NavLink>
                </BrowserRouter></NavbarBrand>
            <Nav className="ml-auto" navbar>
                <BrowserRouter>
                    <NavLink tag={RRNavLink} to="/about/">About</NavLink>
                </BrowserRouter>
              <NavItem>
                <BrowserRouter>
                    <NavLink tag={RRNavLink} to="/representatives/">Representatives</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
              <BrowserRouter>
                    <NavLink tag={RRNavLink} to="/">State</NavLink>
                </BrowserRouter>
              </NavItem>
              <NavItem>
                <NavLink href="/">Energy Bills</NavLink>
              </NavItem>
         
            </Nav>
        </Navbar>
      
        
      </div>
      );
    }
}

export default Navigation;
